@Override
public Float get(String key) {
  Integer bucket = normalCompletion.getBucket(key);
  if (bucket == null)
    return null;
  else
    return (float) normalCompletion.getBucket(key) / normalCompletion.getBucketCount();
}

@Override
public Object get(CharSequence key) {
  Integer bucket = normalCompletion.getBucket(key);
  if (bucket == null)
    return null;
  else
    return (float) normalCompletion.getBucket(key) / normalCompletion.getBucketCount();
}

